import React, { Component } from "react";
import logo from "../../images/logo.png";
class NavBarBrand extends Component {
  render() {
    return (
      <a className="navbar-brand mr-auto">
        <img
          src={logo}
          className="d-inline-block align-center"
          alt="logo"
          style={{
            width: "50%"
          }}
        />
      </a>
    );
  }
}

export default NavBarBrand;
